pragma solidity ^0.4.23;

import { KardiaToolkit } from "./KardiaToolkit.sol";

contract Voting is KardiaToolkit {

  struct Votes {
    string voter;
    bytes32 candidate;
    bytes32 network;
  }
  Votes[] result;
  bool isEnable;

  address owner;

  modifier onlyAdmin() {
    if (msg.sender == owner) _;
  }


  constructor(bytes32[] candidateNames, bytes32[] networks, address eventAddress) public {
    // constructor
    candidates = candidateNames;
    requestedDeploy = networks;
    masterAddress = eventAddress;
    isEnable = true;
    owner = msg.sender;
    requestDeploy();
  }

  function closeVote() public onlyAdmin{
    masterAddress.call(bytes4(keccak256("requestInvoke(address,bytes32,bytes32,bytes32)")),
      msg.sender,
      bytes32ToString("close"),
      bytes32ToString("all"),
      bytes32ToString("")
    );
    isEnable = false;
  }

  function isClosed() public view returns(bool) {
    return isEnable == false;
  }

  function vote(bytes32 candidate, string voter, bytes32 network) public {
    if(isEnable == true) {
      Votes memory temp;
      temp.voter = voter;
      temp.candidate = candidate;
      temp.network = network;
      result.push(temp);
    }
  }

  function getVotesByCandidate( bytes32 candidate, bytes32 network) public view returns(uint256) {
    uint256 count =0;
    for(uint256 i=0 ; i<result.length ; i++) {
      Votes memory temp = result[i];
      if(temp.candidate == candidate && temp.network == network){
        count ++;
      }
    }
    return count;
  }
}
